BEGIN;
CREATE TABLE IF NOT EXISTS "django_migrations" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `content_type_id` integer NOT NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `name` varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "account_user_groups" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `group_id` integer NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "account_user_user_permissions" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` integer NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `object_id` varchars NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0), `change_message` varchars NOT NULL, `content_type_id` integer NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `action_time` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` varchars NOT NULL, `expire_date` datetime NOT NULL);
CREATE TABLE IF NOT EXISTS `account_interest` (`id` char(32) NOT NULL PRIMARY KEY, `interest` varchar(255) NULL);
CREATE TABLE IF NOT EXISTS `account_user_interest` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `interest_id` char(32) NOT NULL REFERENCES `account_interest` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `recipe_recipe` (`id` char(32) NOT NULL PRIMARY KEY, `name` varchar(50) NOT NULL, `description` varchar(200) NOT NULL, `image` varchar(100) NOT NULL, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `fav` integer NOT NULL, `view` integer NOT NULL, `calories` integer NOT NULL, `difficulty` varchar(10) NOT NULL, `duration` integer NOT NULL, `portion` integer NOT NULL, `updated_at` datetime NULL);
CREATE TABLE IF NOT EXISTS `recipe_recipe_ingredient` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `recipe_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED, `ingredient_id` char(32) NOT NULL REFERENCES `recipe_ingredient` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `recipe_recipe_method` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `recipe_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED, `method_id` char(32) NOT NULL REFERENCES `recipe_method` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `recipe_method` (`id` char(32) NOT NULL PRIMARY KEY, `method_varchars` varchars NOT NULL, `recipe_fk_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED, `number` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `recipe_ingredient` (`id` char(32) NOT NULL PRIMARY KEY, `ingredient_varchars` varchars NOT NULL, `recipe_fk_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED, `unit` varchar(10) NOT NULL, `quantity` integer NOT NULL, `number` integer NOT NULL);
CREATE TABLE IF NOT EXISTS `account_user` (`password` varchar(128) NOT NULL, `last_login` datetime NULL, `first_name` varchar(150) NOT NULL, `last_name` varchar(150) NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `id` char(32) NOT NULL PRIMARY KEY, `username` varchar(255) NULL, `email` varchar(254) NOT NULL UNIQUE, `is_admin` bool NOT NULL, `is_staff` bool NOT NULL, `is_superuser` bool NOT NULL, `image` varchar(100) NULL, `bio` varchars NULL, `gender` varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS `account_user_favorite` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `recipe_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `account_user_last_view` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `recipe_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS `recipe_recipe_guest` (`id` integer NOT NULL PRIMARY KEY  AUTO_INCREMENT, `recipe_id` char(32) NOT NULL REFERENCES `recipe_recipe` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` char(32) NOT NULL REFERENCES `account_user` (`id`) DEFERRABLE INITIALLY DEFERRED);
